import React from "react";

const Footer = () => {
  return (
    <div className="footer bg-dark">
      <div className="container">
        <div className="row">
          <div className="col-lg-12 align-items-center">
            <div className="d-flex justify-content-center">
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
